import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { Link } from 'react-router-dom';
export default function VizNavigation() {

  return (
      <>
    <Navbar expand="lg" className="navbar-form navbar-fixed-top">
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Link to="/" className="nav-link">Home</Link>
          <Link to="/cat-example" className="nav-link">Example Page</Link>
          <Nav.Link as={Link} activeStyle={{}} to='/cat-example'>Test 2</Nav.Link>
        </Navbar.Collapse>
    </Navbar>
      </>
  );
}
